/**
 * Created by intelligrape on 5/6/17.
 */
import React from 'react';
import './style.css';
import RoutesList from './../RoutesList'
import StartOver from './../StartOver'

import MapBox from './../StartOver'

class Component1 extends React.Component {
  constructor(props) {
    super(props);
    this.state ={
      routeList :false,
      startOver : true
    }
  }

  showRouteList = () => {
    this.setState({
      startOver: !this.state.startOver,
      routeList: !this.state.routeList
    })
  }

  render() {
    return (
      <div>
         <div className="create-another-fleet-route-section">
            <div className="page-center full-height">
             {this.state.routeList && <RoutesList />}
             <StartOver show={this.state.startOver} showFunction={() => this.showRouteList()}/>
            </div>
         </div>		
      </div>
      );
  }
}

export default Component1;
